import React from "react";
import {Typography, IconButton} from "@mui/material";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import GitHubIcon from "@mui/icons-material/GitHub";
import EmailIcon from "@mui/icons-material/Email";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import { Stack } from "@mui/system";

export default function Contacts() {
  return (
    <div>
      <Box
        ml={80}
        pt={3}
        pl={3}
        borderRadius={9}
        sx={{ bgcolor: "black", height: "600px" }}
      >
        <Paper
          sx={{
            bgcolor: "white",
            height: "575px",
            borderRadius: 5,
          }}
        >
          <br />
          <Typography variant="h2"> Keep in touch </Typography>
          <Stack spacing={2}>
            <Box component="span" sx={{ p: 3, border: "1px grey" }}>
              <IconButton href="mailto:alicehaemilee@gmail.com" target="_blank">
                <EmailIcon sx={{ fontSize: 60 }} />
              </IconButton>
              <div>
                <Typography variant="p">
                  {" "}
                  Any questions or comments?{" "}
                </Typography>
              </div>
            </Box>
            <Box component="span" sx={{ p: 3, border: "1px grey" }}>
              <IconButton
                href="https://linkedin.com/in/alicehaemilee"
                target="_blank"
              >
                <LinkedInIcon sx={{ fontSize: 60 }} />
              </IconButton>
              <div>
                <Typography variant="p">
                  {" "}
                  Connect with me on Linkedin!{" "}
                </Typography>
              </div>
            </Box>
            <Box component="span" sx={{ p: 2, border: "1px grey" }}>
              <IconButton href="https://github.com/alicehaemi" target="_blank">
                <GitHubIcon sx={{ fontSize: 60 }} />
              </IconButton>
              <div>
                <Typography variant="p">
                  {" "}
                  Check out my Github Profile!{" "}
                </Typography>
              </div>
            </Box>
          </Stack>
        </Paper>
      </Box>

      <br />
    </div>
  )
}
